import React from "react";
import "./header.css";

export default function Header() {
    return (
        <>
            <header id="header">
                <h1 class="logo">
                    <a href="../pages/main.php">
                        PHP <em>class</em>
                    </a>
                </h1>
            </header>
        </>
    );
}
